<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0, user-scalable=no">
    <title>FPS JS</title>
    <style>
        body {
            margin: 0;
            overflow: hidden;
            background-color: #000;
            font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
            touch-action: none;
        }

        #canvas-container {
            width: 100vw;
            height: 100vh;
            display: block;
        }

        #ui-layer {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            pointer-events: none;
            display: flex;
            flex-direction: column;
            justify-content: space-between;
        }

        #instructions {
            margin-top: 20px;
            text-align: center;
            color: rgba(255, 255, 255, 0.8);
            text-shadow: 0 1px 2px rgba(0, 0, 0, 0.8);
            font-size: 1.2rem;
            pointer-events: none;
        }

        #joystick-zone {
            position: relative;
            width: 120px;
            height: 120px;
            margin-bottom: 40px;
            align-self: flex-start;
            margin-left: 40px;
            background: rgba(255, 255, 255, 0.15);
            border: 2px solid rgba(255, 255, 255, 0.3);
            border-radius: 50%;
            pointer-events: auto;
            touch-action: none;
            backdrop-filter: blur(4px);
        }

        #joystick-knob {
            position: absolute;
            top: 50%;
            left: 50%;
            width: 50px;
            height: 50px;
            background: rgba(255, 255, 255, 0.9);
            border-radius: 50%;
            transform: translate(-50%, -50%);
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.3);
            pointer-events: none;
        }

        .ui-button {
            position: absolute;
            top: 20px;
            right: 20px;
            padding: 12px 24px;
            background: rgba(255, 255, 255, 0.1);
            border: 2px solid rgba(255, 255, 255, 0.2);
            border-radius: 12px;
            color: white;
            font-weight: bold;
            cursor: pointer;
            backdrop-filter: blur(10px);
            transition: all 0.3s cubic-bezier(0.4, 0, 0.2, 1);
            pointer-events: auto;
            text-transform: uppercase;
            letter-spacing: 1px;
            font-size: 0.8rem;
            z-index: 100;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
            display: flex;
            align-items: center;
            justify-content: center;
        }

        #view-toggle {
            width: 50px;
            height: 50px;
            padding: 0;
            border-radius: 50%;
        }

        .ui-button:hover {
            background: rgba(255, 255, 255, 0.2);
            border-color: rgba(255, 255, 255, 0.4);
            transform: translateY(-2px);
            box-shadow: 0 6px 15px rgba(0, 0, 0, 0.2);
        }

        .ui-button:active {
            transform: translateY(0);
        }

        #jump-btn {
            position: absolute;
            bottom: 40px;
            right: 40px;
            top: auto;
            width: 80px;
            height: 80px;
            border-radius: 50%;
            display: none;
            align-items: center;
            justify-content: center;
            font-size: 0.7rem;
            user-select: none;
        }

        #shoot-btn {
            position: absolute;
            bottom: 140px;
            right: 40px;
            top: auto;
            width: 80px;
            height: 80px;
            border-radius: 50%;
            display: none;
            align-items: center;
            justify-content: center;
            font-size: 0.7rem;
            user-select: none;
            background: rgba(255, 200, 0, 0.2);
            border-color: rgba(255, 200, 0, 0.4);
        }

        #shoot-btn:active {
            background: rgba(255, 200, 0, 0.4);
        }

        #fps-counter {
            position: absolute;
            top: 20px;
            left: 20px;
            padding: 8px 16px;
            background: rgba(255, 255, 255, 0.1);
            border: 1px solid rgba(255, 255, 255, 0.2);
            border-radius: 10px;
            color: #00ff88;
            font-family: 'Courier New', Courier, monospace;
            font-weight: bold;
            font-size: 0.9rem;
            pointer-events: none;
            backdrop-filter: blur(10px);
            z-index: 100;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
        }

        #kill-counter {
            position: absolute;
            top: 70px;
            left: 20px;
            padding: 8px 16px;
            background: rgba(255, 255, 255, 0.1);
            border: 1px solid rgba(255, 255, 255, 0.2);
            border-radius: 10px;
            color: #ff4444;
            font-family: 'Courier New', Courier, monospace;
            font-weight: bold;
            font-size: 0.9rem;
            pointer-events: none;
            backdrop-filter: blur(10px);
            z-index: 100;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
            display: none;
        }

        @media (min-width:768px) {
            #joystick-zone {
                margin-bottom: 60px;
                width: 150px;
                height: 150px;
            }
        }

        #crosshair {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            width: 24px;
            height: 24px;
            pointer-events: none;
            z-index: 1000;
            display: flex;
            align-items: center;
            justify-content: center;
        }

        .ch-line {
            position: absolute;
            background: rgba(255, 255, 255, 0.9);
            box-shadow: 0 0 2px rgba(0, 0, 0, 0.5);
        }

        .ch-v {
            width: 2px;
            height: 8px;
        }

        .ch-h {
            width: 8px;
            height: 2px;
        }

        .ch-top {
            top: 0;
        }

        .ch-bottom {
            bottom: 0;
        }

        .ch-left {
            left: 0;
        }

        .ch-right {
            right: 0;
        }

        .ch-dot {
            width: 2px;
            height: 2px;
            background: white;
            border-radius: 50%;
            box-shadow: 0 0 2px rgba(0, 0, 0, 0.5);
        }

        .btn-crosshair {
            position: relative;
            width: 24px;
            height: 24px;
            display: flex;
            align-items: center;
            justify-content: center;
            transform: scale(1.4);
            pointer-events: none;
        }

        .btn-icon-scaled {
            transform: scale(1.4);
        }

        #game-over-screen {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: rgba(139, 0, 0, 0.8);
            display: none;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            z-index: 2000;
            color: white;
            font-family: 'Segoe UI', sans-serif;
            text-align: center;
        }

        #game-over-screen h1 {
            font-size: 3rem;
            margin-bottom: 1rem;
            text-transform: uppercase;
            text-shadow: 0 0 10px rgba(0, 0, 0, 0.5);
        }

        #game-over-screen p {
            font-size: 1.5rem;
        }
    </style>
</head>

<body>
    <div id="canvas-container"></div>
    <div id="ui-layer">
        <div id="crosshair">
            <div class="ch-line ch-v ch-top"></div>
            <div class="ch-line ch-v ch-bottom"></div>
            <div class="ch-line ch-h ch-left"></div>
            <div class="ch-line ch-h ch-right"></div>
            <div class="ch-dot"></div>
        </div>
        <div id="fps-counter">FPS: 0</div>
        <div id="kill-counter">Kills: 0</div>
        <div id="instructions"></div><button id="view-toggle" class="ui-button" title="Toggle View"><svg width="24"
                height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2"
                stroke-linecap="round" stroke-linejoin="round">
                <path d="M1 12s4-8 11-8 11 8 11 8-4 8-11 8-11-8-11-8z"></path>
                <circle cx="12" cy="12" r="3"></circle>
            </svg></button><button id="jump-btn" class="ui-button" title="Jump"><svg class="btn-icon-scaled" width="24"
                height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2"
                stroke-linecap="round" stroke-linejoin="round">
                <path d="M12 19V5M5 12l7-7 7 7" />
            </svg></button><button id="shoot-btn" class="ui-button">
            <div class="btn-crosshair">
                <div class="ch-line ch-v ch-top"></div>
                <div class="ch-line ch-v ch-bottom"></div>
                <div class="ch-line ch-h ch-left"></div>
                <div class="ch-line ch-h ch-right"></div>
                <div class="ch-dot"></div>
            </div>
        </button>
        <div id="joystick-zone">
            <div id="joystick-knob"></div>
        </div>
        <div id="game-over-screen">
            <h1>Game Over</h1>
            <p>Press anything to respawn</p>
        </div>
    </div>
    <script src="https://unpkg.com/three@0.128.0/build/three.min.js"></script>
    <script src="https://cdn.socket.io/4.7.2/socket.io.min.js"></script>
    <script>const isMobile = /Android|webOS|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini/i.test(navigator.userAgent);
        let killCount = 0;
        let killCounterElement;
        let socket;
        if (typeof io !== 'undefined') {
            const serverUrl = window.location.hostname === 'rookeryphysics.github.io'
                ? 'http://localhost:3000'
                : undefined;
            socket = io(serverUrl, {
                reconnectionAttempts: 3,
                timeout: 5000
            });
            socket.on('connect', () => {
                if (killCounterElement) killCounterElement.style.display = 'block';
            });
            socket.on('disconnect', () => {
                if (killCounterElement) killCounterElement.style.display = 'none';
            });
            socket.on('connect_error', () => {
                console.log('Socket connection failed. Continuing in offline mode.');
                socket.id = 'offline_player';
            });
        } else {
            console.log('Socket.io script not loaded. Running in offline mode.');
            socket = {
                id: 'offline_player',
                on: () => { },
                emit: () => { }
            };
        }
        const otherPlayers = {};
        let isDead = false;
        function createPlayerMask() {
            const maskGroup = new THREE.Group();
            const box0Geo = new THREE.BoxGeometry(0.2, 0.2, 0.03);
            const box0Mat = new THREE.MeshStandardMaterial({ color: "#471500" });
            const box0 = new THREE.Mesh(box0Geo, box0Mat);
            maskGroup.add(box0);
            const cylinder1Geo = new THREE.CylinderGeometry(0.01, 0.05, 0.125, 14);
            const cylinder1Mat = new THREE.MeshStandardMaterial({ color: "#888888" });
            const cylinder1 = new THREE.Mesh(cylinder1Geo, cylinder1Mat);
            maskGroup.add(cylinder1);
            const cylinder2Geo = new THREE.CylinderGeometry(0.05, 0.05, 0.05, 6);
            const cylinder2Mat = new THREE.MeshStandardMaterial({ color: "#ff0000" });
            const cylinder2 = new THREE.Mesh(cylinder2Geo, cylinder2Mat);
            cylinder2.position.set(0.05, 0.04, 0);
            cylinder2.rotation.set(1.57, 0, 0);
            maskGroup.add(cylinder2);
            const cylinder3Geo = new THREE.CylinderGeometry(0.05, 0.05, 0.05, 6);
            const cylinder3Mat = new THREE.MeshStandardMaterial({ color: "#ff0000" });
            const cylinder3 = new THREE.Mesh(cylinder3Geo, cylinder3Mat);
            cylinder3.position.set(-0.05, 0.04, 0);
            cylinder3.rotation.set(1.57, 0, 0);
            maskGroup.add(cylinder3);
            const box4Geo = new THREE.BoxGeometry(0.025, 0.01, 0.05);
            const box4Mat = new THREE.MeshStandardMaterial({ color: "#000000" });
            const box4 = new THREE.Mesh(box4Geo, box4Mat);
            box4.position.set(0, -0.03, -0.04);
            box4.rotation.set(0, 1.59, 0);
            maskGroup.add(box4);
            maskGroup.scale.set(6, 6, 6);
            maskGroup.position.set(0, 1.5, 1.05);
            return maskGroup;
        }
        function createGunModel() {
            const gunGroup = new THREE.Group();
            const box0Geo = new THREE.BoxGeometry(0.21, 0.2, 1.2);
            const box0Mat = new THREE.MeshStandardMaterial({ color: "#69e2ce" });
            const box0 = new THREE.Mesh(box0Geo, box0Mat);
            box0.position.set(0, 0.1, 0);
            gunGroup.add(box0);
            const box1Geo = new THREE.BoxGeometry(0.12, 0.12, 1);
            const box1Mat = new THREE.MeshStandardMaterial({ color: "#333333" });
            const box1 = new THREE.Mesh(box1Geo, box1Mat);
            box1.position.set(0, 0.08, -0.8);
            gunGroup.add(box1);
            const muzzle2 = new THREE.Object3D();
            muzzle2.position.set(0, 0.08, -1.3);
            gunGroup.add(muzzle2);
            const box3Geo = new THREE.BoxGeometry(0.28, 0.35, 0.2);
            const box3Mat = new THREE.MeshStandardMaterial({ color: "#1f1f1f" });
            const box3 = new THREE.Mesh(box3Geo, box3Mat);
            box3.position.set(0, 0.04, 0.525);
            gunGroup.add(box3);
            const box4Geo = new THREE.BoxGeometry(0.2, 0.4, 0.15);
            const box4Mat = new THREE.MeshStandardMaterial({ color: "#262626" });
            const box4 = new THREE.Mesh(box4Geo, box4Mat);
            box4.position.set(0, -0.1, -0.3);
            gunGroup.add(box4);
            const box5Geo = new THREE.BoxGeometry(0.2, 0.2, 0.2);
            const box5Mat = new THREE.MeshStandardMaterial({ color: "#575757" });
            const box5 = new THREE.Mesh(box5Geo, box5Mat);
            gunGroup.add(box5);
            const box6Geo = new THREE.BoxGeometry(0.1, 0.1, 0.1);
            const box6Mat = new THREE.MeshStandardMaterial({ color: "#ff0000" });
            const box6 = new THREE.Mesh(box6Geo, box6Mat);
            box6.position.set(0, 0.08, -1.3);
            gunGroup.add(box6);
            const box7Geo = new THREE.BoxGeometry(0.14, 0.05, 0.3);
            const box7Mat = new THREE.MeshStandardMaterial({ color: "#1c1c1c" });
            const box7 = new THREE.Mesh(box7Geo, box7Mat);
            box7.position.set(-0.06, 0.28, -0.15);
            gunGroup.add(box7);
            gunGroup.userData.muzzle = muzzle2;
            return gunGroup;
        }
        function createOtherPlayerMesh(color) {
            const geometry = new THREE.BoxGeometry(2, 4, 2);
            const material = new THREE.MeshStandardMaterial({ color: color || 0xff0000 });
            const mesh = new THREE.Mesh(geometry, material);
            const mask = createPlayerMask();
            mesh.add(mask);
            const gunGroup = createGunModel();
            gunGroup.position.set(0.6, 0.5, 1.4);
            gunGroup.rotation.y = Math.PI;
            mesh.add(gunGroup);
            mesh.userData.gun = gunGroup;
            mesh.userData.mask = mask;
            return mesh;
        }
        const container = document.getElementById('canvas-container');
        const scene = new THREE.Scene();
        scene.background = new THREE.Color(0x87CEEB);
        scene.fog = new THREE.Fog(0x87CEEB, 10, 500);
        const camera = new THREE.PerspectiveCamera(45, window.innerWidth / window.innerHeight, 0.1, 1000);
        camera.position.set(0, 7, -12);
        camera.lookAt(0, 1, 0);
        const renderer = new THREE.WebGLRenderer({
            antialias: true,
            powerPreference: "high-performance"
        });
        renderer.setSize(window.innerWidth, window.innerHeight);
        renderer.setPixelRatio(Math.min(window.devicePixelRatio, 2));
        renderer.shadowMap.enabled = true;
        renderer.shadowMap.type = THREE.PCFSoftShadowMap;
        container.appendChild(renderer.domElement);
        const ambientLight = new THREE.AmbientLight(0xffffff, 0.4);
        scene.add(ambientLight);
        const dirLight = new THREE.DirectionalLight(0xffffff, 0.8);
        dirLight.position.set(5, 10, 5);
        dirLight.castShadow = true;
        dirLight.shadow.mapSize.width = 1024;
        dirLight.shadow.mapSize.height = 1024;
        scene.add(dirLight);
        const planeGeometry = new THREE.PlaneGeometry(400, 400);
        const planeMaterial = new THREE.MeshStandardMaterial({
            color: 0x2e7d32,
            roughness: 0.8,
            metalness: 0.2
        });
        const plane = new THREE.Mesh(planeGeometry, planeMaterial);
        plane.rotation.x = -Math.PI / 2;
        plane.receiveShadow = true;
        scene.add(plane);
        const gridHelper = new THREE.GridHelper(400, 200, 0x666666, 0x333333);
        scene.add(gridHelper);
        const fenceMaterial = new THREE.MeshStandardMaterial({
            color: 0xcccccc,
            metalness: 0.8,
            roughness: 0.2,
            transparent: true,
            opacity: 0.6
        });
        const fenceHeight = 4;
        const fenceThickness = 0.5;
        const wallN = new THREE.Mesh(new THREE.BoxGeometry(400, fenceHeight, fenceThickness), fenceMaterial);
        wallN.position.set(0, fenceHeight / 2, -200);
        scene.add(wallN);
        const wallS = new THREE.Mesh(new THREE.BoxGeometry(400, fenceHeight, fenceThickness), fenceMaterial);
        wallS.position.set(0, fenceHeight / 2, 200);
        scene.add(wallS);
        const wallE = new THREE.Mesh(new THREE.BoxGeometry(fenceThickness, fenceHeight, 400), fenceMaterial);
        wallE.position.set(200, fenceHeight / 2, 0);
        scene.add(wallE);
        const wallW = new THREE.Mesh(new THREE.BoxGeometry(fenceThickness, fenceHeight, 400), fenceMaterial);
        wallW.position.set(-200, fenceHeight / 2, 0);
        scene.add(wallW);
        const paintableObjects = [plane, wallN, wallS, wallE, wallW];
        const droppedItems = [];
        const cubeGeometry = new THREE.BoxGeometry(2, 4, 2);
        const cubeMaterial = new THREE.MeshStandardMaterial({ color: 0x00ff88 });
        const cube = new THREE.Mesh(cubeGeometry, cubeMaterial);
        cube.position.y = 100;
        cube.castShadow = true;
        cube.visible = false;
        scene.add(cube);
        const playerMask = createPlayerMask();
        cube.add(playerMask);
        const meshGun = createGunModel();
        meshGun.position.set(0.6, 0.5, 1.2);
        cube.add(meshGun);
        cube.userData.gun = meshGun;
        cube.userData.mask = playerMask;
        scene.add(camera);
        const gunGroup = createGunModel();
        const muzzle = gunGroup.userData.muzzle;
        if (isMobile) {
            gunGroup.position.set(0.4, -0.5, -1.5);
        } else {
            gunGroup.position.set(0.6, -0.5, -1.2);
        }
        gunGroup.visible = true;
        camera.add(gunGroup);
        const gun = gunGroup;
        let input = { x: 0, y: 0, active: false };
        let viewMode = 'first-person';
        let pitch = 0;
        const mouseSensitivity = 0.002;
        let lastTime = performance.now();
        let frameCount = 0;
        const fpsElement = document.getElementById('fps-counter');
        killCounterElement = document.getElementById('kill-counter');
        if (socket && socket.id && socket.id !== 'offline_player') {
            killCounterElement.style.display = 'block';
        }
        const clock = new THREE.Clock();
        const keys = { w: false, a: false, s: false, d: false };
        let velocityY = 0;
        let isGrounded = true;
        let jumpCount = 0;
        const gravity = -0.015;
        const jumpStrength = 0.35;
        function jump() {
            if (isDead) return;
            if (isGrounded || jumpCount < 2) {
                velocityY = jumpStrength;
                isGrounded = false;
                jumpCount++;
            }
        }
        const bullets = [];
        const bulletGeometry = new THREE.SphereGeometry(0.15, 8, 8);
        const bulletMaterial = new THREE.MeshStandardMaterial({
            color: "#ffff00",
            emissive: "#ffff00",
            emissiveIntensity: 2
        });
        function shoot() {
            if (isDead) return;
            const bullet = new THREE.Mesh(bulletGeometry, bulletMaterial);
            const muzzlePosition = new THREE.Vector3();
            muzzle.updateMatrixWorld(true);
            muzzle.getWorldPosition(muzzlePosition);
            bullet.position.copy(muzzlePosition);
            const cameraDir = new THREE.Vector3(0, 0, -1);
            cameraDir.applyQuaternion(camera.quaternion);
            raycaster.far = 2000;
            raycaster.set(camera.position, cameraDir);
            const targetObjects = [...paintableObjects, ...Object.values(mapBlocks)];
            const intersects = raycaster.intersectObjects(targetObjects);
            let targetPoint;
            if (intersects.length > 0) {
                targetPoint = intersects[0].point;
            } else {
                targetPoint = camera.position.clone().add(cameraDir.multiplyScalar(200));
            }
            const direction = new THREE.Vector3().subVectors(targetPoint, muzzlePosition).normalize();
            const speed = 1.5;
            bullet.userData.velocity = direction.multiplyScalar(speed);
            bullet.userData.aliveTime = 0;
            scene.add(bullet);
            bullets.push(bullet);
            socket.emit('playerShoot', {
                position: bullet.position,
                velocity: bullet.userData.velocity
            });
        }
        const splats = [];
        const particles = [];
        function createExplosion(pos) {
            const particleCount = 12;
            for (let i = 0; i < particleCount; i++) {
                const size = 0.05 + Math.random() * 0.15;
                const partGeom = new THREE.BoxGeometry(size, size, size);
                const partMat = new THREE.MeshBasicMaterial({ color: "#ffff00", transparent: true });
                const p = new THREE.Mesh(partGeom, partMat);
                p.position.copy(pos);
                const velocity = new THREE.Vector3(
                    (Math.random() - 0.5) * 0.4,
                    (Math.random() - 0.5) * 0.4,
                    (Math.random() - 0.5) * 0.4
                );
                p.userData = {
                    velocity: velocity,
                    life: 1.0,
                    decay: 0.02 + Math.random() * 0.03
                };
                scene.add(p);
                particles.push(p);
            }
        }
        function createSplat(pos, normal) {
            const size = 0.4;
            const splatGeom = new THREE.CircleGeometry(size, 8);
            const splatMat = new THREE.MeshStandardMaterial({
                color: "#ffff00",
                transparent: true,
                opacity: 0.9,
                roughness: 0.8,
                metalness: 0
            });
            const splat = new THREE.Mesh(splatGeom, splatMat);
            const offset = normal.clone().multiplyScalar(0.01);
            splat.position.copy(pos).add(offset);
            const target = pos.clone().add(normal);
            splat.lookAt(target);
            splat.userData.aliveTime = 0;
            scene.add(splat);
            splats.push(splat);
            if (splats.length > 200) {
                const old = splats.shift();
                scene.remove(old);
            }
        }
        function dropEquipment(playerMesh, forcedIds = null) {
            if (!playerMesh) return null;
            const ids = {
                mask: (forcedIds && forcedIds.mask) ? forcedIds.mask : `mask_${playerMesh.uuid}_${Date.now()}`,
                gun: (forcedIds && forcedIds.gun) ? forcedIds.gun : `gun_${playerMesh.uuid}_${Date.now()}`
            };
            if (playerMesh.userData.mask) {
                const maskWorldPos = new THREE.Vector3();
                const maskWorldQuat = new THREE.Quaternion();
                playerMesh.userData.mask.getWorldPosition(maskWorldPos);
                playerMesh.userData.mask.getWorldQuaternion(maskWorldQuat);
                const droppedMask = playerMesh.userData.mask.clone();
                scene.add(droppedMask);
                droppedMask.position.copy(maskWorldPos);
                droppedMask.quaternion.copy(maskWorldQuat);
                droppedMask.userData.velocity = new THREE.Vector3(
                    (Math.random() - 0.5) * 0.2,
                    0.3,
                    (Math.random() - 0.5) * 0.2
                );
                droppedMask.userData.angularVelocity = new THREE.Vector3(
                    Math.random() * 0.1,
                    Math.random() * 0.1,
                    Math.random() * 0.1
                );
                droppedMask.userData.itemId = ids.mask;
                droppedItems.push(droppedMask);
            }
            if (playerMesh.userData.gun) {
                const gunWorldPos = new THREE.Vector3();
                const gunWorldQuat = new THREE.Quaternion();

                    playerMesh.position.set(playerInfo.x, playerInfo.y, playerInfo.z);

                    scene.add(playerMesh);

                    scene.add(playerMesh);
                    otherPlayers[playerInfo.id] = playerMesh;

                    scene.remove(otherPlayers[id]);
                    delete otherPlayers[id];

                bullet.position.set(data.position.x, data.position.y, data.position.z);

                scene.add(bullet);
                bullets.push(bullet);

                if (otherPlayers[id]) {
                    dropEquipment(otherPlayers[id], data.droppedIds);
                    otherPlayers[id].visible = false;
                }
            });
            socket.on('itemPickup', (itemId) => {
                for (let i = droppedItems.length - 1; i >= 0; i--) {
                    if (droppedItems[i].userData.itemId === itemId) {
                        scene.remove(droppedItems[i]);
                        droppedItems.splice(i, 1);
                    }
                }
            });
